import React from "react";
import TestCard from "../../components/TestCard";

const Gallery = (props: any) => {
  return (
    <div>
      {/* //* Search Bar */}
      <input type="search" name="testSearch" id="testSearch" />
      <input type="range" name="" id="" />
      {/* //* Test Gallery */}
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
    </div>
  );
};

export default Gallery;
